    return (typeof str === "string");
  }
  /**
   * Tests an variable is being an JavaScript null type
   * @param   {Object}  fun: Testing null value
   * @returns {Boolean} Is a variable a JavaScript null
   */
  static isNull(nullValue)
  {
    return (nullValue === null);
  }
  /**
   * Tests an variable is being an JavaScript undefined value.
   * @param   {Object}  undefinedValue - Testing undefined value.
   * @returns {Boolean} Is a variable a JavaScript undefined.
   */
  static isUndefined(undefinedValue)
