    return (undefinedValue === undefined);
  }
  /**
   * Tests an variable is being an JavaScript function type.
   * @param   {Function}  _function - Testing function value.
   * @returns {Boolean} Is a variable a JavaScript function.
   */
  static isFunction(_function)
  {
    return (typeof _function === "function");
  }
  /**
   * Tests an variable is being an JavaScript object type
   * @param   {Object} object: Testing object value
   * @returns {Boolean} Is a variable a JavaScript object
   */
  static isObject(object)
  {
    return (typeof object === "object");
  }
  /**
   * Tests an variable is being an JavaScript array type
   * @param   {Object} array: Testing object value
   * @returns {Boolean} Is a variable a JavaScript array
   */
  static isArray(array)
  {
    return (array instanceof Array);
  }
  /**
   * Tests an variable is being an JavaScript number type
   * @param   {Object} number: Testing number value
   * @returns {Boolean} Is a variable a JavaScript number
   */
  static isNumber(number)
  {
    return (typeof number === "number");
  }
  /**
   * Defines a invisibles object property (non-enumerable)
   * @param {Object} object: Destination object
   * @param {String} name:   Name of destination property
   * @param {Object} value:  Destination invisible value
   */
  static invisible(object, name, value)
  {
    Object.defineProperty(object, name,
    {
      value     : value,
      writable  : true,
      enumerable: false
    });
  }
  /**
   * Defines a hidden object property (readonly, non-enumerable)
   * @param {Object} object: Destination object
   * @param {String} name:   Name of destination property
   * @param {Object} value:  Destination hidden value
   */
  static hidden(object, name, value)
  {
    Object.defineProperty(object, name,
    {
      value     : value,
      writable  : false,
      enumerable: false
    });
  }
  /**
