   * @param {Object} object: Destination object
   * @param {String} name:   Name of destination property
   * @param {Object} value:  Destination constant value
   */
  static constant(object, name, value)
  {
    Object.defineProperty(object, name,
    {
      value   : value,
      writable: false
    });
  }
  /**
   * Exteds class
   * @param {Function} derivedClass: Derived class
   * @param {Function} baseClass:    Parent class
   */
  static extend(derivedClass, baseClass)
  {
    derivedClass.prototype = Object.create(baseClass.prototype);
    derivedClass.prototype.constructor = derivedClass;
  }
  /**
   * Does deep copy of an object
   * @param {Object} destObj: Destination object
   * @param {Object} srcObj:  Source object
   */
  static copyObject(srcObj)
  {
    return Object.assign({}, srcObj);
    /*var it;

